import Link from "next/link";

export default function Sections() {
  return (
    <React.Fragment>
      <h1 style={{ textAlign: "center" }}>Featured Flowers & Gifts</h1>

      <div className="sectionsWrapper">
        <Link href="/sale">
          <a className="item">
            <img src="/sale.webp" alt="sale" />
            <h2 className="link">Sale</h2>
          </a>
        </Link>
        <Link href="/sympathy">
          <a className="item">
            <img src="/sympathy.webp" alt="sympathy" />
            <h2 className="link">Sympathy</h2>
          </a>
        </Link>
        <Link href="/gifts">
          <a className="item">
            <img src="/gifts.jpg" alt="gifts" />
            <h2 className="link">Gifts</h2>
          </a>
        </Link>
        <Link href="/plants">
          <a className="item">
            <img src="/plants.jpg" alt="plants" />
            <h2 className="link">Plants</h2>
          </a>
        </Link>
        <Link href="/birthday">
          <a className="item">
            <img src="/birthday.webp" alt="birthday" />
            <h2 className="link">Birthday</h2>
          </a>
        </Link>
        <Link href="/samedaydelivery">
          <a className="item">
            <img src="/sddelivery.webp" alt="Same Day Delivery" />
            <h2 className="link">Same Day Delivery</h2>
          </a>
        </Link>
        <style jsx>{`
          .sectionsWrapper {
            display: flex;
            align-items: center;
            flex-wrap: wrap;
            height: 80%;
            text-align: center;
          }

          .item {
            flex-grow: 1;
            text-decoration: none;
            color: #8e7329;
          }

          .item:hover {
            text-decoration: underline;
            line-height: 1;
          }

          .link {
            color: #8e7329;
            text-align: center;
          }
        `}</style>
      </div>
    </React.Fragment>
  );
}
